<!DOCTYPE html>

    <link rel="icon" type="image/svg+xml" href="/swagger-file-generator/vite.svg" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Swagger Config Generator</title>
    <script type="text/javascript">
      (function (l) {
        if (l.search[1] === '/') {
          let decoded = l.search
            .slice(1)
            .split('&')
            .map(function (s) {
              return s.replace(/~and~/g, '&');
            })
            .join('?');
          window.history.replaceState(
            null,
            null,
            l.pathname.slice(0, -1) + decoded + l.hash
          );
        }
      })(window.location);
    </script>
